import React, { Component } from 'react';

class Bench extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: [],
            
        }
        this.handleChange = this.handleChange.bind(this);
        this.warmupClick = this.warmupClick.bind(this);
    }

    handleChange(e) {
        e.preventDefault();
        this.setState({
            value: e.target.value,
        })
    }   



    render() {
        return (
            <div>
                Bench: 
                <span>
                    <input onChange={this.handleChange}></input>
                </span>
                <div>
                    <button onClick={this.warmupClick}>Warm up</button>
                    <div>Warm up 40% of max: {this.state.value*4/10}kg</div>
                    <div>Warm up 50% of max: {this.state.value*5/10}kg</div>
                    <div>Warm up 60% of max: {this.state.value*6/10}kg</div>
                </div>
                <div>70%: {this.state.value*7/10}kg</div>
                <div>80%: {this.state.value*8/10}kg</div>
                <div>90%: {this.state.value*9/10}kg</div>







            </div>
        )
    }
}

export default Bench
